import React from "react";
import styled from "styled-components";
import LinkMenu from "./Footer/LinksMenu";

function Footer() {
	return (
		<Wrapper>
			<LinkMenu />
		</Wrapper>
	);
}

const Wrapper = styled.footer`
	background-color: var(--clr-black);
`;

export default Footer;
